import React from "react";
import { useDispatch, useSelector } from "react-redux";
import { Link, useNavigate } from "react-router-dom";
import { Logouthandleraction } from "../../Redux/action.js";
import { ToastContainer, toast } from "react-toastify";
import "react-toastify/dist/ReactToastify.css";

export const Navbarnew = () => {
  const userName = useSelector((state) => state.mernQuize.userName);
  const adminName = useSelector((state) => state.mernQuize.adminName);
  const navigate = useNavigate();
  const dispatch = useDispatch();

  const logouthandler = () => {
    if (userName || adminName) {
      dispatch(Logouthandleraction());
      toast.success("Successfully logged out");
      navigate("/");
    }
  };

  return (
    <nav className="w-full bg-gray-800 text-white py-4 px-6 flex justify-between items-center">
      <Link to="/" className="text-xl font-semibold">Home</Link>
      <div className="flex space-x-6">
        {userName || adminName ? (
          <>
            <button onClick={() => navigate("/profile")} className="hover:underline">Profile</button>
            <button onClick={logouthandler} className="hover:underline">Logout</button>
          </>
        ) : (
          <Link to="/register" className="hover:underline">Sign In</Link>
        )}
      </div>
      <ToastContainer />
    </nav>
  );
};
